(1, 0, 13000, 13000, 'Administrator', ' ', '', 'administrator', '<p>System Administrator has ultimate control over all data, users, and extensions on the site. Use with care and protect against others accessing this account.</p>', 1, 0, 0, 1, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 0, 1, 18, 1, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"42",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 1),
(2, 0, 13000, 13000, 'Public', ' ', '', 'public', '<p>All visitors, regardless of whether or not the visitor is logged on, are members of the <strong>Public</strong> group.</p>', 1, 0, 0, 1, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 0, 2, 7, 1, 0, '{\n"group_web_address":"",\n"group_email_address":"",\n"group_owner":"0",\n"group_collection_id":"0"\n}', '{}', '{}', 'en-GB', 0, 2),
(3, 0, 13000, 13000, 'Guest', ' ', '', 'guest', '<p>Visitors who are not logged on are members of the <strong>Guest</strong> group.</p>', 1, 0, 0, 1, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 2, 3, 4, 2, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 3),
(4, 0, 13000, 13000, 'Registered', ' ', '', 'registered', '<p>Visitors who are logged on are members of the <strong>Registered</strong> group.</p>', 1, 0, 0, 1, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 2, 5, 6, 2, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 4),
(5, 0, 13000, 13000, 'Developer', ' ', '', 'developer', '<p>Developer group has full control over data, users, and extensions just like the System administratrator. Use with caution.</p>', 0, 0, 0, 0, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 1, 8, 9, 2, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 5),
(6, 0, 13000, 13000, 'Manager', ' ', '', 'manager', '<p>Manager group, default configuration allows users assigned to the group with the ability to manage all content and user data, but not to manage extensions.</p>', 0, 0, 0, 0, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 1, 10, 17, 2, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 6),
(7, 0, 13000, 13000, 'Publisher', ' ', '', 'publisher', '<p>Publisher group, typically configured to provide users assigned to the group with the ability to  <strong>create</strong>, <strong>update</strong> and <strong>publish</strong> content, but not delete or administer it. Note: use the Resource Options to enable all users to manage content they created.</p>', 0, 0, 0, 0, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 6, 11, 16, 3, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 7),
(8, 0, 13000, 13000, 'Editor', ' ', '', 'editor', '<p>Editor group, typically configured to provide users assigned to the group with the ability to  <strong>create</strong> and <strong>update</strong> content, but not publish, delete or administer it. Note: use the Resource Options to enable all users to manage content they created.</p>', 0, 0, 0, 0, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 8, 12, 15, 4, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 8),
(9, 0, 13000, 13000, 'Author', ' ', '', 'author', '<p>Author group, typically configured to provide users assigned to the group with the ability to  <strong>create</strong> content, but not update, publish, delete or administer it. Note: use the Resource Options to enable all users to manage content they created.</p>', 0, 0, 0, 0, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 1, 9, 13, 14, 5, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{}', '{}', 'en-GB', 0, 9);
